import * as React from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card'
import TextField from '@mui/material/TextField';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
export default function PostForm() {
  return (
    <Card sx={{ m: 5, width: 300, height: 480 }}>
      <CardContent>
        <Box
          component='form'
          sx={{
            // '& .MuiTextField-root': { m: 1, width: '25ch' },
            width: 300,
            height: 600,
            m: 5,
          }}
          noValidate
          autoComplete='off'
        >
          <div sx={{ mt: 2 }}>
            <TextField
              id='outlined-Creator-input'
              label='Creator'
              sx={{ mb: 1 }}
            />
            <TextField id='outlined-Title-input' label='Title' sx={{ mb: 1 }} />
            <TextField
              id='outlined-Message-input'
              label='Message'
              inputProps={{
                style: {
                  height: '40px',
                },
              }}
              sx={{ mb: 1 }}
            />
            <TextField id='outlined-Tags-input' label='Tags' sx={{ mb: 1 }} />
          </div>
          <div>
            <Button variant='outlined' sx={{ mb: 1 }}>
              Choose file..
            </Button>
          </div>
          <div>
            <Button variant='contained' color='success' sx={{ mb: 1 }}>
              Submit
            </Button>
          </div>

          <div>
            <Button variant='contained' color='error' sx={{ mb: 1 }}>
              clear
            </Button>
          </div>
        </Box>
      </CardContent>
    </Card>
  );
}
